import React from "react";
import NavItem from '../navigation-item'

const NavList=()=>{
    return(
        <>
        <h1>List</h1>
        <NavItem/>
        <NavItem/>
        <NavItem/>
        <NavItem/>
        </>
    )
}
export default NavList
